import React from "react";
import { Typewriter } from "react-simple-typewriter";

const MyTypeWriter = () => {
  return (
    <div className="App">
      <Typewriter
        words={[
          "Full Stack Developer",
          "Enthusiastic New Dev",
          "Cross Platforms",
          "Blochchain Rookie Developer",
        ]}
        loop={5}
        cursor
        cursorStyle="_"
        typeSpeed={70}
        deleteSpeed={50}
        delaySpeed={1000}
      />
    </div>
  );
};

export default MyTypeWriter;
